export default function Main() {

  return (
    <main
      className="main"
      style={{
        width: '80vh',
        height: '80vh',
        marginTop: '50px',
        backgroundColor: '#F5F5F5',
        borderRadius: '10px',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center'
      }}
    >
        <Die />   
        <Die />   
        <Die />   
        <Die />   
        <Die />   
        <Die />   
        <Die />   
        <Die />   
        <Die />   
        <Die />   
    </main>
  );
};
